    "python-dateutil",
    "pytz",
    "regex!=2019.02.19,!=2021.8.27,<2022.3.15",
    "tzlocal",
]

[[package]]
name = "flask"
version = "2.2.2"
requires_python = ">=3.7"
summary = "A simple framework for building complex web applications."
dependencies = [
    "Jinja2>=3.0",
    "Werkzeug>=2.2.2",
    "click>=8.0",
    "itsdangerous>=2.0",
]

[[package]]
name = "itsdangerous"
version = "2.1.2"
requires_python = ">=3.7"
summary = "Safely pass data to untrusted environments and back."

[[package]]
name = "jinja2"
version = "3.1.2"
requires_python = ">=3.7"
summary = "A very fast and expressive template engine."
dependencies = [
    "MarkupSafe>=2.0",
]

[[package]]
name = "markupsafe"
version = "2.1.1"
requires_python = ">=3.7"
summary = "Safely add untrusted strings to HTML/XML markup."

[[package]]
name = "python-dateutil"
version = "2.8.2"
requires_python = "!=3.0.*,!=3.1.*,!=3.2.*,>=2.7"
